INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float, attribute_original_id, sort_key_int, sort_key_string, data_type_string) VALUES (1128,'eng-GB',2,284,121,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\"\n         xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\">\n  <paragraph>The very close competition was finished late last night after 3 am. Rider the underdog beat the favourite and let the celebrations start with his familiy and friends as soon as it was decided.</paragraph>\n  <paragraph>This was fun was all he had to say when it was over. I will just have a small dring and then go to bed and sleep like a champion. It will be a nice feeling.</paragraph>\n  <paragraph>Rider today insisted he will face a &quot;big summer&quot; as he will attempt to piece together a season which can make a stronger challenge for next season&apos;s Premiership crown. </paragraph>\n  <paragraph>Rider was disappointed with his finish in the league last season and he is working hard, like everyone else, to bid for the title next year as well. </paragraph>\n  <paragraph>&quot;It&apos;s been the greatest of seasons on the league front, and in Europe,&quot; he said. </paragraph>\n  <paragraph>&quot;I won the league now and also won the Open Cup but set my sights much higher than that and, overall, it&apos;s been an ok season. </paragraph>\n  <paragraph>&quot;Hopefully I will get even better next year. It&apos;s a really important summer for me and my mates. But it&apos;s certainly a big summer.&quot;</paragraph>\n</section>',1045487555,0,0,0,'','ezxmltext');
